import React from 'react';

class Cruises extends React.Component{
    render(){
        return(
            <div>

                <div>
                    <input list="where" placeholder="where are you going?"/>
                    <datalist id="where">
                        <option value="Alaska"/>
                        <option value="Canada"/>
                        <option value="Hawaii"/>
                        <option value="Mexico"/>
                        <option value="Europe"/>
                    </datalist>
                </div>

                <div>
                    <input list="line" placeholder="which cruise line?"/>
                    <datalist id="line">
                        <option value="MCS cruise"/>
                        <option value="Costa cruise"/>
                        <option value="Disney cruise"/>

                    </datalist>
                </div>
            </div>

        );
    }
}

export default Cruises;
